import './App.css';
import { Routes, Route, HashRouter } from 'react-router-dom';
import Home from './pages/Home/Home';
import Navigation from './components/shared/Navigation/Navigation';

function App() {
  return (
    <HashRouter>
    <Navigation/>
    <Routes>
      <Route>
        <Home/>
      </Route>
    </Routes>
    </HashRouter>
  );
}
export default App;
